query auditFeed ( $accountIDs:[ID!] $timeFrame:TimeFrame! $auditFieldFilterInput:[AuditFieldFilterInput!] $marker:String $fieldNames:[AuditFieldName!]) {
	auditFeed ( accountIDs:$accountIDs timeFrame:$timeFrame filters:$auditFieldFilterInput marker:$marker ) {
		from
		to
		marker
		fetchedCount
		hasMore
		accounts {
			id
			records ( fieldNames:$fieldNames   ) {
				admin {
					id
					name
					type
				}
				apiKey {
					id
					name
					type
				}
				object {
					id
					name
					type
				}
				account {
					entity {
						id
						name
						type
					}
					description
					helperFields
				}
				time
				fields {
					name
					value {
						__typename
						... on StringValue {
							string
						}
						... on DateValue {
							date
						}
						... on Entity {
							id
							name
							type
						}
					}
 {
						__typename
						... on StringValue {
							string
						}
						... on DateValue {
							date
						}
						... on Entity {
							id
							name
							type
						}
					}
				}
				fieldsMap
				flatFields
			}
		}
	}	
}
